@Override
public float MontantApayerParClient(Integer idClient){
    float total=0;

    Client ccc= clientRepo.findById(idClient).orElse(null);
    Set<Plat> liste= ccc.getPlats();
    for(Plat p:liste){
        total+=p.getPrix();
        return total;
    }
}

